import React, { useEffect, useState } from "react";
import { Link, useLocation } from "react-router-dom";
import {
  MDBModal,
  MDBModalDialog,
  MDBModalContent,
  MDBModalHeader,

  MDBModalBody,
  MDBModalFooter,
} from "mdb-react-ui-kit";
import moment from "moment";

function Ticket() {
  const img_300 = "https://image.tmdb.org/t/p/w300";

  const location = useLocation();

  const name = location.state.name;
  const mvedata = location.state.data;
  const title = location.state.title;
  const mail = location.state.mail;
  const city = location.state.city;
  const year = location.state.year;

  var days = [
    {
      id: 0,
      name: "button-1",
      date: moment().add(1, "days").format("ddd, D MMM"),
    },
    {
      id: 1,
      name: "button-2",
      date: moment().add(2, "days").format("ddd, D MMM"),
    },
    {
      id: 2,
      name: "button-3",
      date: moment().add(3, "days").format("ddd, D MMM"),
    },
  ];

  var theatres = [
    { name: "PVR" },
    { name: "PVP" },
    { name: "INOX" },
    { name: "IMAX" },
  ];

  var costs = [
    { cost: "200", value: "200 -Reclinear" },
    { cost: "150", value: "150 -Balcony" },
    { cost: "100", value: "100 -Normal" },
  ];

  const [movie, setmovieData] = useState([]);
  const [cost, setCost] = useState(null);
  const [found, setNotFound] = useState(null);
  const [credits, setCredits] = useState(null);
  const [centredModal, setCentredModal] = useState(false);
  const [centredModal1, setCentredModal1] = useState(false);
  const [activebutton, setactive] = useState(null);
  const [activeb, setactiveb] = useState(null);
  const [trailer, setTrailer] = useState(null);
  const [review, setReview] = useState(null);

  const toggleShow = () => setCentredModal(!centredModal);
  const toggleShow1 = () => setCentredModal1(!centredModal1);

  function handlecost(data) {
    setCost(data);
  }
  function dateclick(data) {
    setactive(data);
  }
  function theatreclick(data) {
    setactiveb(data);
  }

  useEffect(() => {
    fetch(
      `https://www.omdbapi.com/?t=${title}&y=2024&plot=full&apikey=961ea94b`
    )
      .then((res) => res.json())
      .then((data) => setmovieData(data))

      .catch((err) => {
        setNotFound(true);
      });
  }, []);
 /* eslint-disable */console.log(...oo_oo(`1295041879_92_1_92_24_4`,mvedata.id));
  useEffect(() => {
    fetch(
      `https://api.themoviedb.org/3/movie/${mvedata.id}/credits?api_key=bee8ce9f0d5a33ee50837d31a61a64eb`
    )
      .then((res) => res.json())
      .then((data) => setCredits(data.cast))

      .catch((err) => {
        setNotFound(true);
      });
  }, []);
  useEffect(() => {
    fetch(
      `https://api.themoviedb.org/3/movie/${mvedata.id}/videos?api_key=bee8ce9f0d5a33ee50837d31a61a64eb`
    )
      .then((res) => res.json())
      .then((data) => setTrailer(data.results))

      .catch((err) => {
        setNotFound(true);
      });
  }, []);
  useEffect(() => {
    fetch(
      `https://api.themoviedb.org/3/movie/${mvedata.id}/reviews?api_key=bee8ce9f0d5a33ee50837d31a61a64eb`
    )
      .then((res) => res.json())
      .then((data) => setReview(data.results))

      .catch((err) => {
        setNotFound(true);
      });
  }, []);

  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);
/* eslint-disable */console.log(...oo_oo(`1295041879_130_0_130_18_4`,movie));
  var credit = null;

  if (credits !== null) {
    credit = credits.slice(0, 6);
  }
  var reviewss = null;
  if (review !== null) {
    reviewss = review.slice(0, 3);
  }
  var num = 0;

  if (movie.imdbVotes !== undefined) {
    for (var i = 0; i < movie.imdbVotes.length; i++) {
      if (movie.imdbVotes[i] !== ",") {
        num += movie.imdbVotes[i];
      }
    }
  }
  var imdb = "N/A";
  var num3 = parseInt(mvedata.vote_average);
  imdb = movie.imdbRating === "N/A" ? num3 : movie.imdbRating;
  var num1 = parseInt(num);
  num1 = num1 / 1000;
  num1 = Math.ceil(num1);
  var num2 = parseInt(mvedata.vote_count);

  num2 = num2 / 1000;
  num2 = Math.ceil(num2);
  var t = parseInt(movie.Runtime);
  var h = Math.floor(t / 60);
  var min = Math.floor(t % 60);

  var votes = movie.imdbRating === "N/A" ? num2 : num1;

  var plot =
    movie.Plot?.length >= mvedata.overview?.length
      ? movie.Plot
      : mvedata.overview;

  return (
    <>
      <div className="movie">
        <div className="moviep">
          <div className="poster">
            <figure>
              <img
                className="movie-image"
                src={`https://image.tmdb.org/t/p/w500/` + mvedata.poster_path}
              />
              <figcaption1>
                <div
                  style={{
                    display: "flex",
                    flexWrap: "wrap",
                    justifyContent: "space-evenly",
                  }}
                >
                  <div>
                    <button className="figcaptionbutton" onClick={toggleShow}>
                      <i
                        className="fa-brands fa-youtube"
                        style={{ color: "#FF0000", backgroundColor: "white" }}
                      ></i>
                      &nbsp; Watch Trailer
                    </button>
                  </div>
                  <div>
                    <button className="figcaptionbutton" onClick={toggleShow1}>
                      <i class="fa-solid fa-magnifying-glass"></i>
                      &nbsp;&nbsp;Reviews
                    </button>
                  </div>
                </div>
              </figcaption1>
            </figure>
          </div>
          <MDBModal tabIndex="-1" show={centredModal} setShow={setCentredModal}>
            <MDBModalDialog centered size="lg">
              <MDBModalContent>
                <MDBModalHeader>
                  <strong>{movie.Title}- Trailer</strong>
                </MDBModalHeader>
                <MDBModalBody>
                  {trailer !== null && (
                    <ul className="ulvideo">
                      {trailer
                        .filter((data) => data.name.includes("Trailer"))
                        .map((data1) => (
                          <div className="videodata">
                            <li>{data1.name}</li>
                            <a
                              target="_blank"
                              href={`https://www.youtube.com/watch/${data1.key}`}
                            >
                              <button className="videodatabutton">
                                <i
                                  className="fa-brands fa-youtube"
                                  style={{ color: "#FF0000" }}
                                ></i>
                              </button>
                            </a>
                          </div>
                        ))}
                    </ul>
                  )}
                </MDBModalBody>
                <MDBModalFooter>
                  <button className="close" onClick={toggleShow}>
                    Close
                  </button>
                </MDBModalFooter>
              </MDBModalContent>
            </MDBModalDialog>
          </MDBModal>
          <MDBModal
            tabIndex="-1"
            show={centredModal1}
            setShow={setCentredModal1}
          >
            <MDBModalDialog centered size="lg">
              <MDBModalContent>
                <MDBModalHeader>
                  <strong>{movie.Title}-Reviews</strong>
                </MDBModalHeader>
                <MDBModalBody>
                  {review?.length === 0 && (
                    <div
                      style={{
                        display: "flex",
                        flexWrap: "wrap",
                        justifyContent: "center",
                      }}
                    >
                      <div style={{ marginRight: "10px", marginTop: "5px" }}>
                        <i class="fa-solid fa-magnifying-glass fa-2x"></i>
                      </div>

                      <div>
                        <h2>NO REVIEWS</h2>
                      </div>
                    </div>
                  )}
                  {review !== null && (
                    <ul>
                      {review.map((data) => (
                        <li>
                          <div className="reviewdata">
                            <div
                              style={{
                                display: "flex",
                                flexWrap: "wrap",
                                justifyContent: "space-between",
                                outline: "1px solid black",
                                padding: " 10px ",
                              }}
                            >
                              {" "}
                              <p>
                                Name:&nbsp;
                                <b>{data.author}</b>
                              </p>
                              <p>
                                Rating: <b>{data.author_details.rating}/10</b>
                              </p>
                            </div>

                            <p style={{ padding: " 10px " }}>{data.content}</p>
                          </div>
                        </li>
                      ))}
                    </ul>
                  )}
                </MDBModalBody>
                <MDBModalFooter>
                  <button className="close" onClick={toggleShow1}>
                    Close
                  </button>
                </MDBModalFooter>
              </MDBModalContent>
            </MDBModalDialog>
          </MDBModal>
          <div className="matter">
            <h1 className="matter-title">{title} </h1>

            <div className="rating">
              <span className="imdb">
                <h2 className="abcd">
                  <i
                    className="fa-sharp fa-solid fa-star"
                    style={{ color: "#f84464" }}
                  ></i>
                  {imdb}/10
                </h2>
              </span>
              <span>
                <strong>{votes}k</strong> votes
              </span>
            </div>

            <div className="elements">
              <ul>
                <li>
                  {h}hr {min}min
                </li>
                <li
                  style={{
                    borderRadius: "10%",
                    backgroundColor: "#D8D9DA",
                    padding: "0 5px",
                  }}
                >
                  {movie.Genre}
                </li>
              </ul>
            </div>
            <div className="language">
              <ul>
                <li>{movie.Language}</li>
                <li
                  style={{
                    borderRadius: "40%",
                    backgroundColor: "#D8D9DA",
                    padding: "0 5px",
                    marginBottom: "0px",
                  }}
                >
                  U/A
                </li>
              </ul>
            </div>

            <div className="date">
              <label>
                <strong>SelectDate </strong>
              </label>
              {days.map((data) => (
                <button
                  type="button"
                  name={data.date}
                  id={
                    activebutton === data.date ? "datebuttonid" : "datebutton"
                  }
                  onClick={() => dateclick(data.date)}
                >
                  {data.date}
                </button>
              ))}
            </div>
            <div className="theatre">
              <label>
                <strong>Select Theatre </strong>
              </label>
              {theatres.map((data) => (
                <button
                  type="button"
                  name={data.cost}
                  id={activeb === data.name ? "datebuttonid" : "datebutton"}
                  onClick={() => theatreclick(data.name)}
                >
                  {data.name}
                </button>
              ))}
            </div>
            {activebutton && activeb && (
              <div className="theatre1">
                <label>
                  <strong>Select Cost </strong>
                </label>
                {costs.map((data) => (
                  <button
                    type="button"
                    name={data.cost}
                    value={data.value}
                    id={cost === data.cost ? "datebuttonid" : "datebutton"}
                    onClick={() => handlecost(data.cost)}
                  >
                    {data.value}
                  </button>
                ))}
              </div>
            )}
            {cost && activebutton && activeb && (
              <Link
                className="book-ticket"
                state={{
                  data: activeb,
                  cost: cost,
                  date: activebutton,
                  name: name,
                  photo: mvedata.poster_path,
                  title: title,
                  mail: mail,
                  city: city,
                }}
                to="booking"
              >
                <button type="button" className="ticket-button">
                  Book tickets
                </button>
              </Link>
            )}
          </div>
        </div>
      </div>
      <div style={{ height: "50px" }}></div>
      <div className="plot" id="plot">
        <h4>
          <strong
            style={{
              borderRadius: "10px",
              backgroundColor: "#D8D9DA",
              padding: "0 5px",
            }}
          >
            About the Movie
          </strong>
        </h4>

        <div className="plotdata">
          <p>{plot}</p>
        </div>
      </div>
      <div className="plot">
        <h4>
          <strong
            style={{
              borderRadius: "10px",
              backgroundColor: "#D8D9DA",
              padding: "0 5px",
            }}
          >
            Starring
          </strong>{" "}
        </h4>
        <div className="cast">
          {credit &&
            credit.map((c) => (
              <div className="castimages">
                <div className="castimage">
                  <div>
                    <a target="_blank">
                      <img
                        className="cast-img"
                        src={
                          c.profile_path
                            ? `${img_300}/${c.profile_path}`
                            : `https://cdn.vectorstock.com/i/1000x1000/22/05/male-profile-picture-vector-1862205.webp`
                        }
                        height="150"
                        width="150"
                      />
                    </a>
                  </div>
                  <div className="castbuttons">
                    <div className="a1234">
                      <a
                        href={`https://en.wikipedia.org/wiki/${c?.name}`}
                        target="_blank"
                      >
                        <button className="castbutton">
                          <i class="fa-brands fa-wikipedia-w"></i>
                        </button>
                      </a>
                    </div>

                    <div className="a1234">
                      <a
                        href={`https://www.google.com/search?q=${c?.name}`}
                        target="_blank"
                      >
                        <button className="castbutton">
                          <i class="fa-brands fa-google"></i>
                        </button>
                      </a>
                    </div>
                  </div>
                </div>

                <div>
                  <p style={{ marginTop: "10px" }}>{c?.name}</p>
                </div>
              </div>
            ))}
        </div>
        {!credit && <p>{movie.Actors}</p>}
      </div>
      <div className="plot">
        <h4>
          <strong
            style={{
              borderRadius: "10px",
              backgroundColor: "#D8D9DA",
              padding: "0 5px",
            }}
          >
            Directed by
          </strong>
        </h4>
        <div className="castimage">
          
            <img
              className="cast-img"
              src={`https://cdn.vectorstock.com/i/1000x1000/22/05/male-profile-picture-vector-1862205.webp`}
              height="150"
              width="150"
            />
   
          <div className="castbuttons">
            <div className="a1234">
              <a
                href={`https://en.wikipedia.org/wiki/${movie.Director}`}
                target="_blank"
              >
                <button className="castbutton">
                  <i class="fa-brands fa-wikipedia-w"></i>
                </button>
              </a>
            </div>

            <div className="a1234">
              <a
                href={`https://www.google.com/search?q=${movie.Director}`}
                target="_blank"
              >
                <button className="castbutton">
                  <i class="fa-brands fa-google"></i>
                </button>
              </a>
            </div>
          </div>
        </div>
        <p style={{ marginTop: "10px" }}>{movie.Director}</p>
      </div>
      <div className="plot">
        <h4>
          <strong
            style={{
              borderRadius: "10px",
              backgroundColor: "#D8D9DA",
              padding: "0 5px",
            }}
          >
            {review?.length === 0 ? "No reviews" : "Top Reviews"}
          </strong>
        </h4>

        <div style={{ display: "flex", flexWrap: "wrap", marginTop: "10px" }}>
          {reviewss !== null &&
            reviewss.map((data) => (
              <div className="reviewdata1">
                <div
                  style={{
                    display: "flex",
                    flexWrap: "wrap",
                    justifyContent: "space-between",
                    outline: "1px solid black",
                    padding: " 10px ",
                    position: "sticky",
                  }}
                >
                  {" "}
                  <p>
                    Name:&nbsp;
                    <b>{data.author}</b>
                  </p>
                  <p>
                    Rating: <b>{data.author_details.rating}/10</b>
                  </p>
                </div>

                <p style={{ margin: "10px" }}>{data.content}....</p>
              </div>
            ))}
        </div>
      </div>
    </>
  );
}

